/**
 * ===== SISTEMA LEITOR QR CODE PATRIMÔNIO =====
 * Sistema completo para leitura e geração de QR Codes patrimoniais
 * com funcionalidades de exportação e persistência de dados
 * 
 * Versão: 2.0
 * Autor: Sistema Patrimônio
 */

// ===== CONFIGURAÇÕES GLOBAIS =====
const CONFIG = {
    itemsPerPage: 10,
    qrReaderConfig: {
        fps: 10,
        qrbox: { width: 250, height: 250 },
        aspectRatio: 1.0,
        disableFlip: false,
        videoConstraints: {
            width: { ideal: 1280 },
            height: { ideal: 720 },
            facingMode: "environment",
            advanced: [{ focusMode: "continuous" }]
        }
    },
    animations: {
        fadeIn: 'fade-in',
        highlight: 'new-row',
        highlightDuration: 2000
    }
};

// ===== VARIÁVEIS GLOBAIS =====
let html5QrCode = null;
let isScanning = false;
let patrimonioData = [];
let editModal = null;
let currentPage = 1;
let searchTerm = '';

// ===== ELEMENTOS DOM =====
const elements = {
    // Scanner
    startBtn: document.getElementById('startBtn'),
    stopBtn: document.getElementById('stopBtn'),
    cameraStatus: document.getElementById('cameraStatus'),

    // Dados
    dataTableBody: document.getElementById('dataTableBody'),
    totalItems: document.getElementById('totalItems'),
    searchInput: document.getElementById('searchInput'),

    // Ações
    clearBtn: document.getElementById('clearBtn'),
    exportExcelBtn: document.getElementById('exportExcelBtn'),
    exportPdfBtn: document.getElementById('exportPdfBtn'),

    // Modal
    editModal: document.getElementById('editModal'),
    editForm: document.getElementById('editForm'),
    saveEditBtn: document.getElementById('saveEditBtn'),

    // Alertas
    alertContainer: document.getElementById('alertContainer'),

    // Gerador QR Code
    qrText: document.getElementById('qr-text'),
    colorPicker: document.getElementById('color-picker'),
    bgColorPicker: document.getElementById('bg-color-picker'),
    qrSize: document.getElementById('qr-size'),
    generateBtn: document.getElementById('generate-btn'),
    downloadBtn: document.getElementById('download-btn'),
    clearBtn: document.getElementById('clear-btn'),
    qrContainer: document.getElementById('qr-container'),
    qrCanvas: document.getElementById('qrcode'),
    status: document.getElementById('status')
};

// ===== INICIALIZAÇÃO =====
document.addEventListener('DOMContentLoaded', function () {
    initializeSystem();
});

function initializeSystem() {
    try {
        loadDataFromStorage();
        setupEventListeners();

        // Inicializar modal se existir
        if (elements.editModal) {
            editModal = new bootstrap.Modal(elements.editModal);
        }

        // Verificar suporte à câmera se estiver na página principal
        if (elements.startBtn) {
            checkCameraSupport();
        }

        updateUI();
        updateTable();
        showAlert('Sistema iniciado com sucesso!', 'success', 3000);

    } catch (error) {
        console.error('Erro na inicialização:', error);
        showAlert('Erro ao inicializar o sistema.', 'danger');
    }
}

// ===== PERSISTÊNCIA DE DADOS =====
function saveDataToStorage() {
    try {
        localStorage.setItem('patrimonioData', JSON.stringify(patrimonioData));
    } catch (error) {
        console.error('Erro ao salvar dados:', error);
        showAlert('Erro ao salvar dados localmente.', 'warning');
    }
}

function loadDataFromStorage() {
    try {
        const saved = localStorage.getItem('patrimonioData');
        if (saved) {
            patrimonioData = JSON.parse(saved);
            // Garantir que todos os itens tenham ID único
            patrimonioData.forEach(item => {
                if (!item.id) {
                    item.id = Date.now() + Math.random();
                }
            });
        }
    } catch (error) {
        console.error('Erro ao carregar dados:', error);
        patrimonioData = [];
        showAlert('Erro ao carregar dados salvos.', 'warning');
    }
}

// ===== EVENTOS =====
function setupEventListeners() {
    // Scanner (se existir)
    if (elements.startBtn) elements.startBtn.addEventListener('click', startScanning);
    if (elements.stopBtn) elements.stopBtn.addEventListener('click', stopScanning);

    // Dados
    if (elements.clearBtn) elements.clearBtn.addEventListener('click', clearData);
    if (elements.exportExcelBtn) elements.exportExcelBtn.addEventListener('click', exportToExcel);
    if (elements.exportPdfBtn) elements.exportPdfBtn.addEventListener('click', exportToPDF);
    if (elements.searchInput) elements.searchInput.addEventListener('input', handleSearch);
    if (elements.saveEditBtn) elements.saveEditBtn.addEventListener('click', saveEdit);

    // Formulário manual (se existir)
    const manualForm = document.getElementById('manualAddForm');
    if (manualForm) {
        manualForm.addEventListener('submit', handleManualAdd);
    }

    // Gerador QR Code (se existir)
    if (elements.generateBtn) elements.generateBtn.addEventListener('click', generateQRCode);
    if (elements.downloadBtn) elements.downloadBtn.addEventListener('click', downloadQRCode);
    if (elements.clearBtn) elements.clearBtn.addEventListener('click', clearQRForm);

    // Fechar alertas
    document.addEventListener('click', function (e) {
        if (e.target.classList.contains('btn-close')) {
            e.target.closest('.alert').remove();
        }
    });
}

// ===== SCANNER QR CODE =====
function checkCameraSupport() {
    if (!navigator.mediaDevices || !navigator.mediaDevices.getUserMedia) {
        showAlert('Seu navegador não suporta acesso à câmera.', 'danger');
        if (elements.startBtn) elements.startBtn.disabled = true;
        return false;
    }
    return true;
}

async function startScanning() {
    if (isScanning) return;

    try {
        html5QrCode = new Html5Qrcode("qr-reader");
        await html5QrCode.start(
            { facingMode: "environment" },
            CONFIG.qrReaderConfig,
            onScanSuccess,
            onScanFailure
        );

        isScanning = true;
        updateScannerUI(true);
        updateCameraStatus('connected', 'Conectado');
        showAlert('Scanner iniciado com sucesso!', 'success', 3000);

    } catch (error) {
        console.error('Erro ao iniciar scanner:', error);
        handleScannerError(error);
    }
}

async function stopScanning() {
    if (!isScanning || !html5QrCode) return;

    try {
        await html5QrCode.stop();
        html5QrCode.clear();
        html5QrCode = null;
        isScanning = false;

        updateScannerUI(false);
        updateCameraStatus('disconnected', 'Desconectado');
        showAlert('Scanner parado.', 'info', 3000);

    } catch (error) {
        console.error('Erro ao parar scanner:', error);
        showAlert('Erro ao parar scanner.', 'warning');
    }
}

function handleScannerError(error) {
    let message = 'Erro ao acessar câmera.';

    if (error.message.includes('Permission denied')) {
        message = 'Permissão de câmera negada. Verifique as configurações do navegador.';
    } else if (error.message.includes('NotFoundError')) {
        message = 'Câmera não encontrada. Verifique se há uma câmera conectada.';
    }

    showAlert(message, 'danger');
    updateScannerUI(false);
    updateCameraStatus('disconnected', 'Erro');
}

function updateScannerUI(scanning) {
    if (elements.startBtn) elements.startBtn.disabled = scanning;
    if (elements.stopBtn) elements.stopBtn.disabled = !scanning;
}

function updateCameraStatus(status, text) {
    if (elements.cameraStatus) {
        elements.cameraStatus.textContent = text;
        elements.cameraStatus.className = `camera-status ${status}`;
    }
}

function onScanSuccess(decodedText) {
    const parsedData = parseQRCodeData(decodedText);

    if (parsedData) {
        addPatrimonioData(parsedData);
        showAlert(`QR Code lido: ${parsedData.patrimonio}`, 'success', 3000);

        // Feedback tátil
        if (navigator.vibrate) {
            navigator.vibrate(200);
        }
    } else {
        showAlert('QR Code inválido ou formato não reconhecido.', 'warning');
    }
}

function onScanFailure(error) {
    // Manter silencioso para não poluir o console
}

// ===== PROCESSAMENTO DE DADOS =====
function parseQRCodeData(qrText) {
    try {
        const lines = qrText.split('\n').map(l => l.trim()).filter(l => l);
        const data = {};

        for (const line of lines) {
            const [key, ...valueParts] = line.split(':');
            const value = valueParts.join(':').trim();

            if (key && value) {
                const normalizedKey = key.toLowerCase().trim();

                if (normalizedKey.includes('patrimônio') || normalizedKey.includes('patrimonio')) {
                    data.patrimonio = value;
                } else if (normalizedKey.includes('item')) {
                    data.item = value;
                } else if (normalizedKey.includes('coordenação') || normalizedKey.includes('coordenacao')) {
                    data.coordenacao = value;
                } else if (normalizedKey.includes('servidor')) {
                    data.servidor = value;
                } else if (normalizedKey.includes('coordenador')) {
                    data.coordenador = value;
                }
            }
        }

        // Validar campos obrigatórios
        if (data.patrimonio && data.item && data.coordenacao && data.servidor && data.coordenador) {
            data.dataHora = new Date().toLocaleString('pt-BR');
            data.id = Date.now() + Math.random();
            return data;
        }

        return null;
    } catch (error) {
        console.error('Erro ao processar QR Code:', error);
        return null;
    }
}

function addPatrimonioData(data) {
    // Verificar duplicatas
    const exists = patrimonioData.find(item =>
        item.patrimonio === data.patrimonio && item.item === data.item
    );

    if (exists) {
        showAlert(`Patrimônio ${data.patrimonio} já foi registrado.`, 'warning');
        return;
    }

    patrimonioData.push(data);
    saveDataToStorage();
    updateTable();
    updateUI();
}

function handleManualAdd(event) {
    event.preventDefault();

    const formData = {
        patrimonio: document.getElementById('inputPatrimonio').value.trim(),
        item: document.getElementById('inputItem').value.trim(),
        coordenacao: document.getElementById('inputCoordenacao').value.trim(),
        servidor: document.getElementById('inputServidor').value.trim(),
        coordenador: document.getElementById('inputCoordenador').value.trim()
    };

    // Validar campos
    const emptyFields = Object.entries(formData).filter(([key, value]) => !value);
    if (emptyFields.length > 0) {
        showAlert('Por favor, preencha todos os campos obrigatórios.', 'warning');
        return;
    }

    const newData = {
        ...formData,
        dataHora: new Date().toLocaleString('pt-BR'),
        id: Date.now() + Math.random()
    };

    addPatrimonioData(newData);
    event.target.reset();
    showAlert('Patrimônio adicionado com sucesso!', 'success', 3000);
}

// ===== INTERFACE DE USUÁRIO =====
function updateUI() {
    const hasData = patrimonioData.length > 0;

    if (elements.totalItems) {
        elements.totalItems.textContent = patrimonioData.length;
    }

    // Habilitar/desabilitar botões
    if (elements.clearBtn) elements.clearBtn.disabled = !hasData;
    if (elements.exportExcelBtn) elements.exportExcelBtn.disabled = !hasData;
    if (elements.exportPdfBtn) elements.exportPdfBtn.disabled = !hasData;
}

function handleSearch() {
    searchTerm = elements.searchInput.value.toLowerCase();
    currentPage = 1;
    updateTable();
}

function updateTable() {
    if (!elements.dataTableBody) return;

    // Filtrar dados
    let filtered = patrimonioData;
    if (searchTerm) {
        filtered = patrimonioData.filter(item =>
            Object.values(item).some(val =>
                typeof val === 'string' && val.toLowerCase().includes(searchTerm)
            )
        );
    }

    // Paginação
    const total = filtered.length;
    const start = (currentPage - 1) * CONFIG.itemsPerPage;
    const end = start + CONFIG.itemsPerPage;
    const pageData = filtered.slice(start, end);

    // Renderizar tabela
    elements.dataTableBody.innerHTML = '';

    if (pageData.length === 0) {
        const row = document.createElement('tr');
        row.innerHTML = `
            <td colspan="8" class="text-center text-muted py-4">
                <i class="bi bi-inbox" style="font-size: 2rem;"></i>
                <p class="mt-2 mb-0">Nenhum dado encontrado</p>
            </td>
        `;
        elements.dataTableBody.appendChild(row);
    } else {
        pageData.forEach((item, idx) => {
            const row = createTableRow(item, start + idx + 1);
            elements.dataTableBody.appendChild(row);
        });
    }

    renderPagination(total);
}

function createTableRow(item, index) {
    const row = document.createElement('tr');
    row.className = CONFIG.animations.fadeIn;

    const isSmallScreen = window.innerWidth < 576;

    row.innerHTML = `
        <td data-label="Nº"><strong>${index}</strong></td>
        <td data-label="Patrimônio">
            <span class="badge bg-primary">${escapeHtml(item.patrimonio)}</span>
        </td>
        <td data-label="Item">${escapeHtml(item.item)}</td>
        <td data-label="Coordenação">
            <span class="badge bg-secondary">${escapeHtml(item.coordenacao)}</span>
        </td>
        <td data-label="Servidor(a)">${escapeHtml(item.servidor)}</td>
        <td data-label="Coordenador">${escapeHtml(item.coordenador)}</td>
        <td data-label="Data/Hora">
            <small class="text-muted">${item.dataHora}</small>
        </td>
        <td data-label="Ações" class="action-cell">
            <button class="btn btn-sm btn-outline-primary action-btn" 
                    onclick="editItem('${item.id}')" 
                    title="Editar">
                <i class="bi bi-pencil"></i>
            </button>
            <button class="btn btn-sm btn-outline-danger action-btn" 
                    onclick="deleteItem('${item.id}')" 
                    title="Excluir">
                <i class="bi bi-trash"></i>
            </button>
        </td>
    `;

    return row;
}

function renderPagination(total) {
    const paginationContainer = document.getElementById('paginationControls');
    if (!paginationContainer) return;

    const totalPages = Math.ceil(total / CONFIG.itemsPerPage);

    if (totalPages <= 1) {
        paginationContainer.innerHTML = '';
        return;
    }

    let paginationHTML = '';

    // Botão anterior
    paginationHTML += `
        <li class="page-item ${currentPage === 1 ? 'disabled' : ''}">
            <a class="page-link" href="#" onclick="changePage(${currentPage - 1})">
                <i class="bi bi-chevron-left"></i>
            </a>
        </li>
    `;

    // Páginas
    for (let i = 1; i <= totalPages; i++) {
        if (i === 1 || i === totalPages || (i >= currentPage - 2 && i <= currentPage + 2)) {
            paginationHTML += `
                <li class="page-item ${i === currentPage ? 'active' : ''}">
                    <a class="page-link" href="#" onclick="changePage(${i})">${i}</a>
                </li>
            `;
        } else if (i === currentPage - 3 || i === currentPage + 3) {
            paginationHTML += `<li class="page-item disabled"><span class="page-link">...</span></li>`;
        }
    }

    // Botão próximo
    paginationHTML += `
        <li class="page-item ${currentPage === totalPages ? 'disabled' : ''}">
            <a class="page-link" href="#" onclick="changePage(${currentPage + 1})">
                <i class="bi bi-chevron-right"></i>
            </a>
        </li>
    `;

    paginationContainer.innerHTML = paginationHTML;
}

function changePage(page) {
    const totalPages = Math.ceil(patrimonioData.length / CONFIG.itemsPerPage);
    if (page >= 1 && page <= totalPages) {
        currentPage = page;
        updateTable();
    }
}

// ===== AÇÕES DE DADOS =====
function editItem(itemId) {
    const item = patrimonioData.find(p => p.id == itemId);
    if (!item) return;

    document.getElementById('editIndex').value = itemId;
    document.getElementById('editPatrimonio').value = item.patrimonio;
    document.getElementById('editItem').value = item.item;
    document.getElementById('editCoordenacao').value = item.coordenacao;
    document.getElementById('editServidor').value = item.servidor;
    document.getElementById('editCoordenador').value = item.coordenador;

    editModal.show();
}

function saveEdit() {
    const itemId = document.getElementById('editIndex').value;
    const item = patrimonioData.find(p => p.id == itemId);

    if (!item) return;

    // Validar campos
    const newData = {
        patrimonio: document.getElementById('editPatrimonio').value.trim(),
        item: document.getElementById('editItem').value.trim(),
        coordenacao: document.getElementById('editCoordenacao').value.trim(),
        servidor: document.getElementById('editServidor').value.trim(),
        coordenador: document.getElementById('editCoordenador').value.trim()
    };

    const emptyFields = Object.entries(newData).filter(([key, value]) => !value);
    if (emptyFields.length > 0) {
        showAlert('Por favor, preencha todos os campos obrigatórios.', 'warning');
        return;
    }

    // Atualizar item
    Object.assign(item, newData);

    saveDataToStorage();
    updateTable();
    editModal.hide();
    showAlert('Dados atualizados com sucesso!', 'success', 3000);
}

function deleteItem(itemId) {
    const item = patrimonioData.find(p => p.id == itemId);
    if (!item) return;

    if (confirm(`Tem certeza que deseja excluir o patrimônio "${item.patrimonio}"?`)) {
        patrimonioData = patrimonioData.filter(p => p.id != itemId);
        saveDataToStorage();
        currentPage = 1;
        updateTable();
        updateUI();
        showAlert(`Patrimônio "${item.patrimonio}" removido com sucesso.`, 'info', 3000);
    }
}

function clearData() {
    if (confirm('Tem certeza que deseja limpar todos os dados? Esta ação não pode ser desfeita.')) {
        patrimonioData = [];
        saveDataToStorage();
        currentPage = 1;
        updateTable();
        updateUI();
        showAlert('Todos os dados foram removidos.', 'info', 3000);
    }
}

// ===== GERADOR QR CODE =====
function generateQRCode() {
    const text = elements.qrText?.value.trim();
    if (!text) {
        showAlert('Por favor, insira o texto para gerar o QR Code.', 'warning');
        return;
    }

    const color = elements.colorPicker?.value || '#000000';
    const bgColor = elements.bgColorPicker?.value || '#FFFFFF';
    const size = parseInt(elements.qrSize?.value) || 300;

    const options = {
        width: size,
        height: size,
        color: {
            dark: color,
            light: bgColor
        },
        margin: 2,
        errorCorrectionLevel: 'M'
    };

    // Mostrar loading
    if (elements.status) {
        elements.status.innerHTML = '<i class="bi bi-hourglass-split"></i> Gerando QR Code...';
        elements.status.className = 'loading';
    }

    QRCode.toCanvas(elements.qrCanvas, text, options, function (error) {
        if (error) {
            console.error('Erro ao gerar QR Code:', error);
            showAlert('Erro ao gerar QR Code.', 'danger');
            if (elements.status) {
                elements.status.innerHTML = '<i class="bi bi-x-circle"></i> Erro ao gerar QR Code';
                elements.status.className = 'error';
            }
        } else {
            // Mostrar QR Code gerado
            displayGeneratedQR();
            if (elements.downloadBtn) elements.downloadBtn.disabled = false;
            if (elements.status) {
                elements.status.innerHTML = '<i class="bi bi-check-circle"></i> QR Code gerado com sucesso!';
                elements.status.className = 'success';
            }
            showAlert('QR Code gerado com sucesso!', 'success', 3000);
        }
    });
}

function displayGeneratedQR() {
    if (!elements.qrContainer || !elements.qrCanvas) return;

    // Criar imagem a partir do canvas
    const img = document.createElement('img');
    img.src = elements.qrCanvas.toDataURL();
    img.className = 'img-fluid';
    img.style.maxWidth = '100%';
    img.style.height = 'auto';
    img.style.border = '2px solid var(--border-color)';
    img.style.borderRadius = 'var(--border-radius-sm)';
    img.style.boxShadow = 'var(--shadow-md)';

    // Substituir conteúdo do container
    elements.qrContainer.innerHTML = '';
    elements.qrContainer.appendChild(img);
}

function downloadQRCode() {
    if (!elements.qrCanvas) return;

    try {
        const link = document.createElement('a');
        link.download = `qrcode-patrimonio-${Date.now()}.png`;
        link.href = elements.qrCanvas.toDataURL();
        link.click();

        showAlert('QR Code baixado com sucesso!', 'success', 3000);
    } catch (error) {
        console.error('Erro ao baixar QR Code:', error);
        showAlert('Erro ao baixar QR Code.', 'danger');
    }
}

function clearQRForm() {
    if (elements.qrText) {
        elements.qrText.value = `Patrimônio: 
Item: 
Coordenação: 
Servidor(a): 
Coordenador: `;
    }

    if (elements.colorPicker) elements.colorPicker.value = '#000000';
    if (elements.bgColorPicker) elements.bgColorPicker.value = '#FFFFFF';
    if (elements.qrSize) elements.qrSize.value = '300';
    if (elements.downloadBtn) elements.downloadBtn.disabled = true;

    // Limpar visualização
    if (elements.qrContainer) {
        elements.qrContainer.innerHTML = `
            <div class="text-muted">
                <i class="bi bi-qr-code" style="font-size: 4rem; opacity: 0.3;"></i>
                <p class="mt-2">Clique em "Gerar QR Code" para visualizar</p>
            </div>
        `;
    }

    if (elements.status) {
        elements.status.innerHTML = '';
        elements.status.className = '';
    }

    showAlert('Formulário limpo.', 'info', 2000);
}

// ===== EXPORTAÇÃO =====
async function exportToExcel() {
    if (patrimonioData.length === 0) {
        showAlert('Não há dados para exportar.', 'warning');
        return;
    }

    try {
        const workbook = new ExcelJS.Workbook();
        const sheet = workbook.addWorksheet('Patrimônios');

        const hoje = new Date();
        const dataFormatada = hoje.toLocaleDateString('pt-BR', {
            year: 'numeric',
            month: 'long',
            day: 'numeric',
            hour: '2-digit',
            minute: '2-digit'
        });

        // Cabeçalho do relatório
        sheet.mergeCells('A1:G1');
        sheet.getCell('A1').value = 'Relatório de Patrimônios';
        sheet.getCell('A1').font = { bold: true, size: 16, color: { argb: 'FFFFFF' } };
        sheet.getCell('A1').alignment = { horizontal: 'center' };
        sheet.getCell('A1').fill = { type: 'pattern', pattern: 'solid', fgColor: { argb: '0D6EFD' } };

        sheet.mergeCells('A2:G2');
        sheet.getCell('A2').value = `Gerado em: ${dataFormatada}`;
        sheet.getCell('A2').font = { bold: true, color: { argb: 'FFFFFF' } };
        sheet.getCell('A2').alignment = { horizontal: 'center' };
        sheet.getCell('A2').fill = { type: 'pattern', pattern: 'solid', fgColor: { argb: '0D6EFD' } };

        sheet.mergeCells('A3:G3');
        sheet.getCell('A3').value = `Total de itens: ${patrimonioData.length}`;
        sheet.getCell('A3').font = { bold: true, color: { argb: 'FFFFFF' } };
        sheet.getCell('A3').alignment = { horizontal: 'center' };
        sheet.getCell('A3').fill = { type: 'pattern', pattern: 'solid', fgColor: { argb: '0D6EFD' } };

        // Linha vazia
        sheet.addRow([]);

        // Cabeçalhos das colunas
        const headers = ['Nº', 'Patrimônio', 'Item', 'Coordenação', 'Servidor(a)', 'Coordenador', 'Data/Hora'];
        const headerRow = sheet.addRow(headers);

        headerRow.eachCell(cell => {
            cell.font = { bold: true, color: { argb: 'FFFFFF' } };
            cell.fill = { type: 'pattern', pattern: 'solid', fgColor: { argb: '495057' } };
            cell.alignment = { horizontal: 'center' };
            cell.border = {
                top: { style: 'thin' },
                bottom: { style: 'thin' },
                left: { style: 'thin' },
                right: { style: 'thin' }
            };
        });

        // Dados
        patrimonioData.forEach((item, index) => {
            const row = sheet.addRow([
                index + 1,
                item.patrimonio,
                item.item,
                item.coordenacao,
                item.servidor,
                item.coordenador,
                item.dataHora
            ]);

            const bgColor = index % 2 === 0 ? 'F8F9FA' : 'FFFFFF';
            row.eachCell(cell => {
                cell.fill = { type: 'pattern', pattern: 'solid', fgColor: { argb: bgColor } };
                cell.alignment = { horizontal: 'left' };
                cell.border = {
                    top: { style: 'thin' },
                    bottom: { style: 'thin' },
                    left: { style: 'thin' },
                    right: { style: 'thin' }
                };
            });
        });

        // Ajustar largura das colunas
        const columnWidths = [8, 15, 40, 20, 25, 25, 20];
        columnWidths.forEach((width, index) => {
            sheet.getColumn(index + 1).width = width;
        });

        // Filtro automático
        sheet.autoFilter = {
            from: 'A5',
            to: `G${sheet.rowCount}`
        };

        // Congelar cabeçalho
        sheet.views = [{ state: 'frozen', xSplit: 0, ySplit: 5 }];

        // Exportar
        const buffer = await workbook.xlsx.writeBuffer();
        const blob = new Blob([buffer], {
            type: 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet'
        });

        const link = document.createElement('a');
        link.href = URL.createObjectURL(blob);
        link.download = `patrimonio_${hoje.getFullYear()}${String(hoje.getMonth() + 1).padStart(2, '0')}${String(hoje.getDate()).padStart(2, '0')}_${String(hoje.getHours()).padStart(2, '0')}${String(hoje.getMinutes()).padStart(2, '0')}.xlsx`;
        link.click();

        showAlert('Arquivo Excel exportado com sucesso!', 'success', 3000);

    } catch (error) {
        console.error('Erro ao exportar Excel:', error);
        showAlert('Erro ao exportar arquivo Excel.', 'danger');
    }
}

function exportToPDF() {
    if (patrimonioData.length === 0) {
        showAlert('Não há dados para exportar.', 'warning');
        return;
    }

    try {
        const { jsPDF } = window.jspdf;
        const doc = new jsPDF({ orientation: 'landscape', unit: 'mm', format: 'a4' });

        const hoje = new Date();
        const dataFormatada = hoje.toLocaleDateString('pt-BR', {
            year: 'numeric',
            month: 'long',
            day: 'numeric',
            hour: '2-digit',
            minute: '2-digit'
        });

        // Título
        doc.setFontSize(18);
        doc.setFont('helvetica', 'bold');
        doc.text('Relatório de Patrimônios', 148, 20, { align: 'center' });

        doc.setFontSize(12);
        doc.setFont('helvetica', 'normal');
        doc.text(`Gerado em: ${dataFormatada}`, 148, 30, { align: 'center' });
        doc.text(`Total de itens: ${patrimonioData.length}`, 148, 40, { align: 'center' });

        // ADICIONE O SEU CÓDIGO BASE64 AQUI
        // Exemplo: const logoBase64 = 'data:image/png;base64,iVBORw0KGgo...';
        const logoBase64 = 'data:image/png;base64,'; // <<< SUBSTITUA PELO SEU BASE64

        if (logoBase64) {
            try {
                doc.addImage(logoBase64, 'PNG', 15, 15, 15, 15); // Ajuste as coordenadas e o tamanho (x, y, width, height)
            } catch (e) {
                console.error("Erro ao adicionar a imagem da logo:", e);
                showAlert('Não foi possível adicionar a logo ao PDF. Verifique o código Base64.', 'warning');
            }
        }

        // Tabela
        const headers = ['Nº', 'Patrimônio', 'Item', 'Coordenação', 'Servidor(a)', 'Coordenador', 'Data/Hora'];
        const data = patrimonioData.map((item, index) => [
            index + 1,
            item.patrimonio,
            item.item,
            item.coordenacao,
            item.servidor,
            item.coordenador,
            item.dataHora
        ]);

        doc.autoTable({
            head: [headers],
            body: data,
            startY: 50,
            styles: {
                fontSize: 8,
                cellPadding: 3
            },
            headStyles: {
                fillColor: [13, 110, 253],
                textColor: 255,
                fontStyle: 'bold'
            },
            alternateRowStyles: {
                fillColor: [248, 249, 250]
            },
            columnStyles: {
                0: { cellWidth: 15 },
                1: { cellWidth: 25 },
                2: { cellWidth: 60 },
                3: { cellWidth: 35 },
                4: { cellWidth: 45 },
                5: { cellWidth: 45 },
                6: { cellWidth: 35 }
            }
        });

        // Salvar
        const filename = `patrimonio_${hoje.getFullYear()}${String(hoje.getMonth() + 1).padStart(2, '0')}${String(hoje.getDate()).padStart(2, '0')}_${String(hoje.getHours()).padStart(2, '0')}${String(hoje.getMinutes()).padStart(2, '0')}.pdf`;
        doc.save(filename);

        showAlert('Arquivo PDF exportado com sucesso!', 'success', 3000);

    } catch (error) {
        console.error('Erro ao exportar PDF:', error);
        showAlert('Erro ao exportar arquivo PDF.', 'danger');
    }
}

// ===== UTILITÁRIOS =====
function showAlert(message, type = 'info', duration = 5000) {
    if (!elements.alertContainer) return;

    const alertId = 'alert-' + Date.now();
    const alertHTML = `
        <div id="${alertId}" class="alert alert-${type} alert-dismissible fade show" role="alert">
            <i class="bi bi-${getAlertIcon(type)}"></i>
            ${escapeHtml(message)}
            <button type="button" class="btn-close" data-bs-dismiss="alert" aria-label="Close"></button>
        </div>
    `;

    elements.alertContainer.insertAdjacentHTML('beforeend', alertHTML);

    // Auto-remover após duração especificada
    if (duration > 0) {
        setTimeout(() => {
            const alertElement = document.getElementById(alertId);
            if (alertElement) {
                alertElement.remove();
            }
        }, duration);
    }
}

function getAlertIcon(type) {
    const icons = {
        success: 'check-circle',
        danger: 'exclamation-triangle',
        warning: 'exclamation-triangle',
        info: 'info-circle'
    };
    return icons[type] || 'info-circle';
}

function escapeHtml(text) {
    const div = document.createElement('div');
    div.textContent = text;
    return div.innerHTML;
}

